import React from 'react';
import './App.css'; // Import CSS styles
import 'bootstrap/dist/css/bootstrap.min.css'; // Import Bootstrap styles
import Carousel from './carousel'; // Import your carousel component

function App() {
  return (
    <div className="page-container">
      {/* Header taking 20% of the page height */}
      <header className="page-header">
        <h1>My Header</h1>
        <button className="login-button" id="LoginButt">Login</button>
      </header>

      {/* Carousel taking the remaining 80% of the page height */}
      <Carousel />
    </div>
  );
}

export default App;
